// import './Footer.css';

const Footer = () => {
  return (
    <footer>
      <p>&copy; 2024 PRECI-COM CNC</p>
      <p>Contact: (123) 456-7890 | Email: info@autoparts.com</p>
      <p>Address: 123 Auto Parts Blvd, Industry City, Country</p>
    </footer>
  );
}

export default Footer;
